import React from 'react';
import me from '../assests/img/me2.jpg'
// import './About.css';

const About = () => {
  return (
    <section id="hero">
    <div class="about-info">
        <h2>About Me</h2>
        <p>I am a web developer with a passion for creating beautiful and functional websites. I have
            experience working with a variety of technologies, including HTML, CSS, JavaScript
            . I am always looking for new challenges and opportunities to learn and grow as a developer.</p>
    </div>
    <div class="me">
        <img src={me} alt=''></img>
    </div>
    </section>
  );
};

export default About;
